import { BrowserRouter as Router, Route, Routes, Link } from 'react-router-dom';
import Visuals from './Visuals';
import Register from './Register';
import AddEvent from './AddEvent';
import { Login, GetUserButton } from './Login';


function App()
{

  return(
    <div>
      <Visuals/>

      <Register/>

      <Login/>

      <GetUserButton/>

     </div>
  );
} 

export default App;
